		/// <summary>
		/// The Common Order segment (ORC) is used to transmit fields that are common to all orders (all types of services that are requested).There is some overlap between fields of the ORC and those in the order detail segments. These are described in the succeeding sections.ORC use notesa) placer order groupsThe Standard supports a mechanism to collect several orders together in a group. Most often this is used to represent an "ordering session" for a single patient.An order group is a list of orders (ORCs) associated with an ORC-4-placer group number. A group is established when the placer supplies a placer group number with the original order. The order group consists of all the ORCs and order detail segments that have the same placer group number. Orders can be removed from the group using cancel, or added using the replacement or parent-child mechanisms. New orders cannot otherwise be added to the group.b) duplicate fieldsThe ORC is intended to uniformly define the fields that are common to all orders (i.e., requested services). Some ORC fields are duplicated in some order detail segments (e.g., OBR, RXO). For example, ORC-2-placer order number has the same meaning and purpose as OBR-2-placer order number field. This promotes upward compatibility with past versions and ASTM.The rule for using these fields is that the value must appear in the order detail segment if it does not appear in the ORC. However, it is recommended to transmit the field value in both places to avoid confusion.c) parent/child  cancel, hold, discontinueDuring transmission of a request to cancel, hold, or discontinue a parent order, the request is intended to apply recursively to the parent order and all associated child orders.For example   1) An EKG application receives an order for three EKGs on successive mornings.   2) The EKG application creates three child orders, one for each requested EKG.   3) The first daily EKG has already been performed when a request is received to cancel the original parent order. (The parent is beyond the point of cancellation.)   4) The remaining, unperformed, children are canceled as a result of the request.
		/// </summary>
		public class ORC {

			 public const string Id = "ORC";

						/// <summary>
			/// ORC.1 - Determines the function of the order segment. Refer to HL7 Table 0119  Order Control Codes for valid entries. Depending on the message, the action of the control code may refer to an order or an individual service. For example, the code CA in an OMP message cancels the order. The same code in an RDS message, cancels the dispense. Very detailed explanatory notes are given at the end of this section.This field may be considered the "trigger event" identifier for orders. The codes fall roughly into the following three categories a) event request  Codes like "NW" (new order) and "CA" (cancel order request) are used to initiate an event . b) event acknowledgment  Codes like "OK" (order accepted) and "CR" (canceled as requested) are used to reply to the event request . c) event notification  Codes like "OC" (order canceled) and "OD" (order discontinued) are used to notify other applications that an event has occurred. No application reply is necessary.Event request codes are intended to initiate an event. Event acknowledgment codes are intended to reply to an application that requested an event. Event notification codes are intended to notify another application that, e.g., the filler has performed some action on an order that the other application, e.g., the placer, needs to know.Fillers, placers, and other applications can use event requests, event acknowledgments, and event  notification-type trigger events interchangeably. However, certain order control codes can originate only from the filler (e.g., CR) and others can only originate from the placer (e.g., CA).Refer to Chapter 2C, Code Tables, "HL7 Table 0119  Order Control Codes".
			/// </summary>
			public class OrderControl : HL7Base<OrderControl>
			{

				private const string _id = "ORC.1";
